import React from 'react';
import {Container, Nav, Navbar } from 'react-bootstrap';
import { NavLink }  from 'react-router-dom';

const homeStyle = {
  fontWeight:'bold'
}

const Header:React.FC = () => {
  return (
    <Navbar collapseOnSelect expand="lg" className="bg-body-tertiary">
      <Container>
        <Navbar.Brand to='/' as={NavLink} style={homeStyle}>&lt;Ionut &#47;&#62;</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
          </Nav>
          <Nav>
          <Nav.Link to='/about-me' as={NavLink}>About Me</Nav.Link>
          <Nav.Link to='/skils' as={NavLink}>Skils</Nav.Link>
          <Nav.Link to='/qualification' as={NavLink}>Qualification</Nav.Link>
          <Nav.Link to='projects' as={NavLink}>Projects</Nav.Link>
          <Nav.Link to='/contact' as={NavLink}>Contact</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Header;
